INSERT INTO `dospres_luaran_lain` (`id_luaran_lain`, `nidn`, `judul_luaran`, `jenis_luaran_lain`, `deskripsi`, `kd_sts_berkas_pendukung`, `keterangan_invalid`, `tahun`, `file`) VALUES
(1, '0019076502', 'Perintisan Koperasi PAUD', 'Model', 'Untuk mengatasi kekurangan dana pada pengelolaan PAUD Enggal Permata di dusun Borotretes desa Donowarih dibentuk kelompok ibu-ibu pengajian yang menjadi orang tua santri untuk membuat koperasi simpan pinjam. Kegiatan ini dirintis oleh kepala sekolah PAUD, ibu Kusmiati.', 0, 'Berkas LL tidak diunggah atau tidak terbaca', 2010, NULL),
(2, '0013066701', 'Pendirian Koperasi Jasa Keuangan Syariah  (KJKS) Bagi Perempuan', 'Model', 'KJKS ini berupaya untuk menerapkan prinsip usaha bersama dan saling tolong menolong (tabarru’). Penghimpunan dana anggota yang berasal dari simpanan produktif dimanfaatkan untuk pengembangan usaha, sementara tolong menolong dalam qordul hasan dipenuhi dari gerakan Ziswaf yang dikelola secara berkelompok.', 0, 'Berkas LL tidak diunggah atau tidak terbaca', 2010, NULL),
(3, '0013066701', 'Strategi Pembelajaran Riil Banking Syariah dan penciptaan unit Produksi Bagi Prodi', 'Model', 'Pengembangan Strategi pembelajaran yang sinergis dan integratif guna mewujudkan kompetensi lulusan Prodi Perbankan dalam manajemen dan operasionalisasi bank syariah. Model pembelajaran berbasis proyek dan mensinergikan kelompok mata kuliah kompetensi bank syariah telah ditunjang dengan perwujudakan laboratorium bank syariah secara riil.  Keseluruhan program telah menunjukkan tanda-tanda dalam mendukung kemandirian Prodi dalam pemenuhan finansial dari adanya keuntungan  yang dihasilkan setiap tahun yang cenderung meningkat.', 0, 'Berkas LL tidak diunggah atau tidak terbaca', 2010, NULL),
(4, '0022066401', 'Model Kebijakan Pengelolaan Ruang Terbuka Hijau (RTH) Publik', 'Model', 'Pengelolaan RTH Publik,merupakan tanggung jawab pemerintah dalam penyediannya. Namun dalam pelaksanaannya diperlukan keterlibatan stakeholder, pemerintah, swasta dan warga. Model ini menggambarkan relasi demokratis atas ketiga stakeholder tersebut. Model ini disebut sebagai model Demokratisasi Peran Akor', 0, 'Berkas LL tidak diunggah atau tidak terbaca', 2010, NULL),
(5, '0722016601', 'Metode Isolasi Bradyrhizobium japonicum dari System Agroforestri', 'Model', 'Metode untuk mengisolasi bakteri Bradyrhizobium japonicum dari tanaman kedelai yang ditanam di bawah tegakan pohon, sebagai agent pupuk hayati tanaman kedelai dalam system agroforstri', 0, 'Berkas LL tidak diunggah atau tidak terbaca', 2010, NULL),
(6, '0712125601', 'Penilai Buku Teks Pelajaran Agama Islam Pendidikan Dasar dan Menengah Tingkat Nasional', 'Model', 'Badan Standar Nasional Pendidikan (BSNP)Pusat Perbukuan Kementerian Pendidikan Nasional', 0, 'Berkas LL tidak diunggah atau tidak terbaca', 2010, NULL),
(7, '0712125601', 'Teaching staff di University of Murcia, Spanyol', 'Model', 'Dosen Islamic Studies di University of Murcia, Spanyol pada tahun 2010 dalam program Erasmus Mundus.', 0, 'Berkas LL tidak diunggah atau tidak terbaca', 2010, NULL),
(8, '0715017101', 'Membuat Pakan Ikan dengan memanfaatkan bahan lokal', 'Teknologi Tepat Guna (TTG)', 'Kegiatan ini didanai dikti melalui skim IbM, kegiatan dilakukan di Petani Ikan Kabupaten Tulungagung. Petani Ikan di Tulungagung sangat tergantung dengan pakan buatan pabrik yang harganya terus meningkat, sementara di lokasi terdapat bahan lokal yang dapat dimanfaatkan untuk penyusun pakan ikan. Pada kegiatan ini petani mulai membuat pakan ikan dengan menyusun formulasi dan mencetak sendiri sehingga bisa memenuhi kebutuhan budidaya. Yang pada akhirnya dapat menekan biaya produksi', 1, 'Berkas LL tidak diunggah atau tidak terbaca', 2010, NULL),
(9, '0721085801', 'Biopestisida untuk tanaman padi', 'Teknologi Tepat Guna (TTG)', 'Pestisida ramah lingkungan untuk tanaman padi', 0, 'Berkas LL tidak diunggah atau tidak terbaca', 2010, NULL),
(10, '0021066601', 'Pendaftaran Paten, judul invensi :Produk Pewarna Alami yang mengandung Vit.A dari Pigmen Ubi jalar Kuning dan Proses Pembuatannya.', 'Model', 'Invensi ini berhubungan dengan produk dan proses pembuatan alami dari ubi jalar kuning, khususnya metode ekstraksi pigmen karotenoid menggunakan eter atau heksan dengan etanol, agar dapat digunakan industri pangan,terutama yang mengandung lemak/lipid. Lebih khusus lagi invensi ini berhubungan dengan proses pembuatan pewarna alami dari ubi jalar dalam bentuk cair-pekat (konsentrat) dan bubuk/powder.', 1, 'Bukan termasuk LL', 2010, NULL),
(11, '0717076602', 'work shop Pembibitan itik cipendui dan itik pajajaran', 'Desain', 'pengembangan itik tradisional ', 0, 'Berkas LL tidak diunggah atau tidak terbaca', 2010, NULL),
(12, '0701068206', 'Pembelajaran Gerak Dasar Renang Sekolah Dasar', 'Prototype', 'Prototipe ini berupa CD pembelajaran yang memberikan kemudahan kepada guru dalam mengenal, meelaksanakan proses pembelajaran khususnya renag di tingkat dasar', 0, 'Berkas LL tidak diunggah atau tidak terbaca', 2011, NULL),
(13, '0019076502', 'Koperasi PAUD Enggal Permata dan SOP Manajemen PAUD', 'Model', 'Program selanjutnya menjadikan Koperasi sebagai pusat kegiatan kewirausahaan ibu-ibu wali santri. Ibu yang memiliki ketrampilan membuat kue untuk dijual dikantin demi ketersediaan makanan sehat bagi anak didik. Usaha ini dikelola koperasi dengan membuka kantinyang menjual  makanan ringan. Untuk memmenuhi kebutuhan sekolah anak-anak dibuka juga warung ATK yang menjual berbagai alat tulis dan buku bacanak-anak. Untuk penyelenggaraan sinergitas kegiatan PAUD dan Koperasidibuatlah SOP Manajemen.\n', 0, 'Berkas LL tidak diunggah atau tidak terbaca', 2011, NULL),
(14, '0013066701', 'Baitul Maal Rasinda (2011)', 'Model', 'BMR merupakan organisasi sosial penghimpun Ziswaf, dengan tujuan merapikan manajemen Ziswaf yang telah ada dan mempunyai kecendrungan tidak adanya koordinasi antar lembaga. Gerakan Ziswaf dikembangkan dari kegiatan KJKS yang menghimpun dana tabarru’ dengan berorientasi kepada kebutuhan mustahiq dan pendistribusian secara terkoordinir.', 0, 'Berkas LL tidak diunggah atau tidak terbaca', 2011, NULL),
(15, '0721036201', 'Model Pemberdayaan Masyarakat Partisipative Integrative', 'Rekayasa Sosial', 'Rekayasa Sosial dalam bentuk pemberdayaan masyarakat khususnya komunitas petani bunga kenanga dan penyuling minyak Atsiri dalam meningkatkan industri minyak Atsiri berbasis bunga kenanga', 1, 'Berkas LL tidak diunggah atau tidak terbaca', 2011, NULL),
(16, '0721085801', 'Biopestisida untuk tanaman sawi', 'Teknologi Tepat Guna (TTG)', 'Pestisida ramah lingkungan untuk tanaman sawi', 0, 'Berkas LL tidak diunggah atau tidak terbaca', 2011, NULL),
(17, '0015106302', 'Pemberdayaan Masyarakat Partisipatif Integratif Melalui Pengembangan Industri Non.corporate Menuju Pembangunan Karakter Bangsa yang Berdaya Saing', 'Model', 'Buku panduan untuk membina masyarakat agar mempunyai jiwa kreatif sehingga setiap individu hard skill dan softskill sehingga  mampu bersaing', 0, 'Berkas LL tidak diunggah atau tidak terbaca', 2011, NULL),
(18, '0008106401', 'Pengawetran  Pakan Silase', 'Teknologi Tepat Guna (TTG)', 'Guna Mengantisipasi kukurangan hijauan pada peternak sapi perah di wilayah KUD Ngantang, maka pada menjelang musim kemarau dibuatkan pengawetam hijauam dengan cara fermentasi menggunakan mikroba. Hijauan tebon jagung, dicacah ukuran 2- 5 cm, dilayukan, dicampur bekatul 2%, mikroba 1% dan tetes 2% kemudian diperam secara an aerob selama 3 minggu.', 0, 'Berkas LL tidak diunggah atau tidak terbaca', 2011, NULL),
(19, '0717045901', 'Liku-Liku Perjuangan Meraih “Dunia Putih” Seorang Rasman Pengantar Buku Berjudul Menggapai Cahaya ; Dari Balik Jeruji ke Puncak Pemimpin Ummat', 'Rekayasa Sosial', 'Kehidupannya kini telah berubah seratus persen, sebagai seorang ustadz yang disegani oleh kawan dan lawan, dan kiprahnya diperhitungkan oleh pemerintah setempat. Ia telah meletakkan Islam tidak hanya sebagai harapan tetapi sebagai pandangan hidup (way of live) dan mendakwakannya di tengah-tengah hiruk pikuknya kehidupan sekular yang tak bersahabat di kota dan Negara kelahirannya, Singapur. Keinginan yang kuat sebagai pendakwah Islam inilah mendorongnya bergabung dengan Muhammadiyah Singapur. Karena prestasinya yangh cukup menonjol, Muhammadiyah berharap menjadikan Rasman sebagai kader terbaik, sehingga ia dikirim ke Indonesia untuk mencari dan mendalami Islam dan studi lanjut (S-1) di Universitas Muhammadiyah Malang. Setelah ia menyelesaikan sarjana (S-1) ia kembali dan mengabdikan dirinya di Muhammadiyah seperti semula. Namun dalam perjalanannya ia tidak cukup puas berdakwa melalui institusi yang dianggap kurang dinamis dan kurang melakukan inovasi-inovasi model dakwah. Keinginan kuat', 1, 'Bukan termasuk LL', 2011, NULL),
(20, '0717045901', 'RESTORASI PERGURUAN TINGGI AGAMA ISLAM DI ERA GLOBALISASI Dinamika UIN Malang di Tangan Pemimpin Inovatif dan Kreatif', 'Rekayasa Sosial', 'Globalisasi dapat dikaji berdasarkan aspek-aspek; ekonomi, sosial-politik, dan aspek kultural. Aspek ekonomi menunjukkan bahwa ekonomi bergerak kearah; perdagangan bebas, perusahaan swasta, investasi asing, dan liberalisasi pembatas perdagangan. Pada aspek sosial politik nampak bahwa politik pemerintahan bergeser dari sentralisasi ke desentralisasi, kehidupan politik dan masyarakat semakin demokratis, kebebasan berpendapat dan berserikat semakin berkembang, berlangsung pemilihan umum yang bebas, dan control masyarakat, khusunya pers, semakin kokoh. Aspek kultural ditunjukkan oleh adanya perubahan pola perilaku termasuk dalm konsumsi, semakin derasnya aliran informasi antarbangsa, dan semakin intensnya komunikasi yang terjadi baik dalam skala nasional maupun internasional. Perguruan Tinggi Agama Islam (IAIN) di Indonesia memiliki dinamikanya sendiri. Perguruan tinggi ini mengahadapi berbagai macam tantangan baik dari internal maupun eksternal. Dihadapkan dengan dunia modern pernah muncu', 1, 'Bukan termasuk LL', 2011, NULL),
(21, '0704087403', 'Pembuatan Peraturan Rektor tentang Sistem penyampaian Kebijakan', 'Rekayasa Sosial', 'Luaran dari kegiatan ini adalah terbentuknya suatu system penyampaian kebijakan secara bertingkat dan terstruktur serta terpadu sehingga kebijakan yang disampaikan akan memiliki satu makna yang sama di tataran penerima kebijakan, dengan memfungsikan humas sebagai penyampai dan filter kebijakan baik keluar maupun kedalam.', 0, 'Berkas LL tidak diunggah atau tidak terbaca', 2011, NULL),
(22, '0704087403', 'Pembuatan Peraturan Universitas Muhammadiyah Malang tentang Sistem dan Mekanisme Pembuatan Keputusan', 'Rekayasa Sosial', 'Luaran dari kegiatan ini adalah suatu peraturan yang mengatur tentang mekanisme pembuatan keputusan pada universitas Muhammadiyah Malang dengan tujuan agar memiliki kekuatan hukum yang mengikat dan tidak menimbulkan multi prestasi serta benturan pada tataran pelaksanaan.', 0, 'Berkas LL tidak diunggah atau tidak terbaca', 2011, NULL),
(23, '0726117804', 'Formula penghambat proses inflamasi konjungtiva kornea (IL 1 dan MMP 9)dan proses epitelisasi kornea berbasis ekstrak jintan hitam (Nigella sativa', 'Teknologi Tepat Guna (TTG)', 'Proposal raih HKI dari Kementrian Ristek dan Teknologi', 0, 'Berkas LL tidak diunggah atau tidak terbaca', 2012, NULL),
(24, '0003095908', 'Manajemen Berbasis Madrasah', 'Model', 'Modul pelatihan yang digunakan secara nasional di bawah kementerian agama bekerjasama dengan Australia’s Education Partnership  with Indonesia School Systems and Quality \n', 0, 'Berkas LL tidak diunggah atau tidak terbaca', 2012, NULL),
(25, '0019076502', 'Koperasi PAUD Tawangargo', 'Model', 'Kegiatan koperasi yang dirasakan sangat membantu manajemen PAUD dikembangkan sampai ke desa Tawangargo. Artinya PAUD Enggal Permata membuka cabang perintisan PAUD melalui pembinaan TPQ.', 0, 'Berkas LL tidak diunggah atau tidak terbaca', 2012, NULL),
(26, '0013066701', 'Kelompok usaha Produktif Bagi Perempuan (2012)', 'Rekayasa Sosial', 'Ibu Rumah tangga yang selama ini belum mampu memberikan kontribusi ekonomi secara produktif kepada keluarga, didorong untuk mengembangkan potensi kreatifnya. Dua kelompok kehlian memasak oleh Ibu Rumah Tangga di Desa Mulyoagung dikolaborasikan dalam suatu usaha bersama, dimana mereka didampingi mulai dari perintisan usaha, kendali mutu sampai pemasaran. Saat ini mereka telah aktif menggerakkan usaha bersama dan mulai menikmati bagi hasil kerja mereka setiap 3 bulan sekali.', 0, 'Berkas LL tidak diunggah atau tidak terbaca', 2012, NULL),
(27, '0721036201', 'Boiler, alat perjang, ekstraktor, formula aroma therapy Cananga', 'Teknologi Tepat Guna (TTG)', 'Teknologi yang menjadi  luaran penelitian unggulan strategis nasional bersama anggota tim :                                           -       Boiler digunakan untuk memperpendek proses penyulingan minyak atsiri                                                     -       Alat perajang untuk pembuatan pupuk yang dapat digunakan petani bunga kenanga untuk mengolah limbah penyulingan minyak atsiri menjadi pupuk organik                 -       Ekstraktor untuk membuat lebih bening minyak atsiri hasil dari penyulingan                                                         -       Formula aroma therapy berbasis minyak atsiri Kenanga untuk diproduksi oleh kelompok petani sebagai home industry yang dapat dikomersialisasikan (didaftarkan merk dagang)\n', 1, 'Berkas LL tidak diunggah atau tidak terbaca', 2012, NULL),
