(34, '0706058402', 'Model pembelajaran pendidikan karakter Pada pembelajaran tematik Di SD Muhammadiyah 9 Kota Malang', 'Model', 'Model pembelajaran pendidikan karakter pada pembelajaran tematik di SD Muhammadiyah 9 Kota Malang terdiri dari perangkat pembelajaran dan panduan siswa. Pemerolehan model tersebut diawali dengan studi literatur, observasi pembelajaran yang dilakukan selama ini, analisis kemudian disusun draf desain model dan dilanjutkan dengan uji coba terbatas di kelas 1 SD', 0, 'Berkas LL tidak diunggah atau tidak terbaca', 2012, NULL),
(35, '0706066501', 'Sel Surya Tembaga Oksida dan Aluminium Oksida Dengan Dielektrikum HCl', 'Prototype', 'Pembuatan sel surya dari bahan daur ulang, teknologi sederhana sehingga harganya murah, kelemahan efisiensi masih rendah.', 0, 'Berkas LL tidak diunggah atau tidak terbaca', 2012, NULL),
