(37, '0701055601', 'Penyusunan Master Plan Pengembangan Kawasan Sumber Maro desa Karangsuko, Kecamatan Pagelaran, Kabupaten Malang', 'Teknologi Tepat Guna (TTG)', 'Penyusunan Master Plan ini dilakukan dengan tujuan untuk mendapatkan rancangan tatanan ruang kawasan wisata Sumber Maron yang dilengkapi dengan fasilitas/infrastruktur terkait, yang dapat menunjang dinamika kegiatan wisata berbasis potensi alam yang ada dan sesuai dengan tema yang dikembangkan.', 0, 'Berkas LL tidak diunggah atau tidak terbaca', 2012, NULL),
(38, '0717076602', 'Accereating Research on Biomas Based Bio Fuel Produktion on Large Scale', 'Teknologi Tepat Guna (TTG)', 'produksi biomasa untuk skala industri', 1, 'Berkas LL tidak diunggah atau tidak terbaca', 2012, NULL),
(39, '0008106401', 'Pemanfaatan Limbah Biogas sebagai pakan ikan', 'Teknologi Tepat Guna (TTG)', 'Guna menurunkan harga pakan ikan, maka kotoran sapi yang telah dibuat biogas limbahnya dapat dimanfaatkan sebagai campuran pakan ikan sampai 30%.Bahan yang dipergunakan selain limbah adalah tepung ikan, bekatul halus, premix, bungkil kedele dan ampas tahu', 1, '', 2012, NULL),
(40, '0008106401', 'Pembuatan mesin model pencacah rumput serbaguna', 'Teknologi Tepat Guna (TTG)', 'Mesin serbaguna ini dapat dipergunakan untuk mencacah rumput kering guna membuat Komplit feed dan sekaligus untuk memperhalus kotoran ternak yang akan dibuat pupuk organik.Kekuatan mesin dengan penggerak disel 8 PK', 1, '', 2012, NULL),
(41, '0717045901', 'Akuntabilitas Tercermin pada Sikap dan Perilaku Pelaku Organisasi : Pengantar', 'Rekayasa Sosial', 'Perubahan perilaku bangsa Indonesia yang paling memprihatinkan dan menjadi sorotan masyarakat di negeri ini adalah perilaku korupsi. Agama seolah-olah “tidak lagi mampu” mengendalikan perilaku korupsi meskipun pelakunya mengaku sebagai “pemeluk Islam”, dan ini sebagai konsekwensi mayoritas penduduk Indonesia beragama Islam. Daya tarik kepentingan dunia lebih kuat dari pada kepentingan kehidupan akhirat. Semua orang ingin secara cepat dapat menikmati kemewahan dunia. Korupsi adalah bentuk perilaku ketidaksabaran dan demi kesenangan hidup dunia. Ajaran Islam tidak hanya mengatur masalah akhlak, tetapi juga mengajarkan manajemen hidup seperti, muhasabah (introspeksi, retrospeksi), tafakkur (self accounting), dan menghindari perbuatan tercela seperti takalluf (sikap atau perbuatan yang melampaui batas kemampuan). Sebagai manusia mukallaf (terbebani tugas ajaran agama) adalah menjalankan aturan-aturan yang telah diatur oleh agama dan tidak boleh bersikap takalluf.', 1, 'Bukan termasuk LL', 2012, NULL),
(42, '0717045901', 'Peran Intelektual Islam Dalam Mencerahkan Umat Melalui Pendidikan Islam di Era Globalisasi*)', 'Rekayasa Sosial', 'Dalam kesempatan ini izinkanlah saya menyampaikan ucapan terima kasih kepada seluruh civitas akademika STIT Muhammadiyah Bangil yang telah memberikan kesempatan kepada saya untuk menyampaikan pidato Wisuda tahun Akademik 2012/2013 ini. Saya akan memanfaatkan momentum yang berharga ini untuk sedikit mengupas tentang ”Peran Intelektual Islam dalam Mencerahkan Umat Melalui Pendidikan Islam di Era Globalisasi.” Tema di atas adalah relevan dengan tugas wisudawan/wati sebagai kaum intelektual Islam yang meneruskan tugas kenabian (prophetic) dalam menyampaikan dakwah Islam melalui bidang pendidikan Islam dalam rangka mencerahkan umat. Muhammad Amin al-Kurdi1, menulis buku dengan judul Tanwir al-Qulub, berarti pencerahan hati. Isinya menyangkut aqidah, syariah dan tasyawuf. Tetapi seluruhnya spiritual enlightenment yang bersifat individual. Hal ini dapat dimaklumi karena ia seorang syekh dalam tareqat naqsyabandiyah. Dalam salah satu bagian dari buku itu, ia menyatakan bahwa pencerahan spiritu', 1, 'Bukan termasuk LL', 2012, NULL),
(43, '0717045901', 'Peran Intelektual Islam Dalam Mencerahkan Umat Melalui Pendidikan Islam di Era Globalisasi*)', 'Rekayasa Sosial', 'Dalam kesempatan ini izinkanlah saya menyampaikan ucapan terima kasih kepada seluruh civitas akademika STIT Muhammadiyah Bangil yang telah memberikan kesempatan kepada saya untuk menyampaikan pidato Wisuda tahun Akademik 2012/2013 ini. Saya akan memanfaatkan momentum yang berharga ini untuk sedikit mengupas tentang ”Peran Intelektual Islam dalam Mencerahkan Umat Melalui Pendidikan Islam di Era Globalisasi.” Tema di atas adalah relevan dengan tugas wisudawan/wati sebagai kaum intelektual Islam yang meneruskan tugas kenabian (prophetic) dalam menyampaikan dakwah Islam melalui bidang pendidikan Islam dalam rangka mencerahkan umat.', 1, 'Bukan termasuk LL', 2012, NULL),
(44, '0717045901', 'Tantangan Intelektual Islam Dalam Mencerahkan Umat di Era Globalisasi*)', 'Rekayasa Sosial', 'Tantangan dalam bidang pendidikan bagi Muhammadiyah, terutama di Singapura sangatlah berat. Kolej Islam Muhammadiyah sebagai salah satu lembaga pendidikan Islam di Singapura harus mampu merespon kondisi yang ada yakni keperluan stake holders (umat Islam) yang hidup di tengah-tengah masyarakat plural, modern dan global. Kolej Islam Muhammadiyah harus mampu ”survive” di tengah-tengah kehidupan masyarakat global Singapura sekarang ini. Bagaimanakah wajah masyarakat global itu? Sebagai manusia, memang kita sadari bersama, menjadi intelektual Islam yang bertanggung jawab secara akademik, diperlukan pergumulan panjang melalui proses perubahan dan pendewasaan serta kematangan diri. Dalam realitas sejarah di dunia ini, tidak satu pun orang besar atau cerdik cendekia, terlahir menjadi orang besar dan terkenal secara instan tetapi melalui proses pergumulan yang cukup panjang. Sebagaimana para ahli sosiologi mengatakan bahwa realitas sosial masyarakat bukanlah sesuatu yang statis-dogmatis melaink', 1, 'Bukan termasuk LL', 2012, NULL),
(45, '0701077301', 'E-Government Success Factors and Measures: Concepts,\nTheories, Experiences, and Practical Recommendations', 'Model', 'E-goverment evaluative practice are exemined here anthropologically by questioning their theoretical and  methodological assumtions. The scope of analysis focuses on the manner by which e-goverment evaluation  is conducted, the objectivity it invokes, and the discourse around which its findings are generalized to the broader public', 0, '', 2013, NULL),
(46, '0022066401', 'Citizen Power Dan Fenomena Korupsi di Daerah', 'Model', 'Masalah Terbesar dalam penyelenggaraan negara dan sistim pemerintahan di indonesia adalah korupsi baik di tingkat pusat maupu daerah', 1, 'Bukan termasuk LL', 2013, NULL),
(47, '0022066401', 'Kebijakan Puplik Dibeliberatif dan Partisipasi Puplik', 'Rekayasa Sosial', 'Kebijakan Puplik Dibeliberatif dan Partisipasi Puplik', 1, 'Bukan termasuk LL', 2013, NULL),
(48, '0022066401', 'Pelayanan Puplik Berbasis New Puplic', 'Kebijakan', 'Penyelenggaraan Pemerintahan yang menjadi kewajiban aparatur pemerintahan adalah penyelenggaraan puplik', 1, 'Bukan termasuk LL', 2013, NULL),
(49, '0028026402', 'Merk dagang "Arrow-rut"', 'Desain', 'Arrow-rut, berasal dari kata Arrowroot, yaitu nama latin dari salah satu ubi-ubian: â€œGARUTâ€, yang didalam bahasa jawa disebut â€œLARUTâ€.  Merk dagang â€œArrow-Rutâ€ sengaja dipilih untuk menghindari kerancuan dengan nama daerah di Jawa Barat: Kabutapen Garut.  Bila menggunakan istilah â€˜LARUTâ€ juga berpotensi rancu dengan salah satu nama reaksi kimia.', 0, 'Berkas LL tidak diunggah atau tidak terbaca', 2013, NULL),
(50, '0026036301', 'Buku Aspek Hukum Bisnis', 'Model', 'Diawali dengan pembahasan mengenai hukum secara umum termasuk pembidangan hukum yang mana dalam buku ini lebih memfokuskan kepada hukum privat (perdata) yang merupakan dasar pijakan untuk pembahasan hukum perdata khusus (hukum dagang) selanjutnya. Perlu juga dikemukakan (hukum) benda yang merupakan obyek hukum yang utama dalam melakukan berbagai macam perjanjian atau perikatan seperti jual beli, sewa menyewa dan leasing. Kemudian di dalam melakukan kegiatan usaha/dagang tentunya juga tidak akan terlepas dari beberapa kewajiban yang harus diktahui atau dipenuhi oleh pelaku dagang misalnya tentang ijin usaha (SIUP), Daftar Perusahaan (DP) dan pembukuan.', 0, '', 2013, NULL),
(51, '0026036301', 'Harmonisasi Konsep Keuangan Negara Terhadap Kepailitan BUMN Persero Demi Menjamin Kepastian Hukum', 'Model', 'Naskah pidato dengan judul “Harmonisasi Konsep Keuangan Negara Terhadap Kepailitan BUMN Persero Demi Menjamin Kepastian Hukum” ini merupakan hasil pergulatan penulis sejak menjadi dosen mata kuliah Hukum Dagang di Fakultas Hukum Universitas Muhammadiyah Malang (1990-sekarang 2011). Penulis konsen dengan kajian-kajian /penelitian di bidang hukum bisnis khususnya bidang kepailitan dan Arbitrase.', 0, '', 2013, NULL),
(52, '0712036401', 'Model Sinergi Kelembagaan Kampus & UMKM untuk Peningkatan Kemandirian Ekonomi UMKM', 'Model', 'Model sinergi Kelembagaan kampus dengan UMKM disekitarnya digerakan oleh Lembaga HIMASEKA (Himpunan Usaha Masyarakat sekitar Kampus) yang dbentuk Oleh Perguruan Tinggi (UMM) sebagai lembaga yang menghubungan antara UMKM sekitar Kampus lembaga yang sinergi lembaga keuangan (pendanaan),  Pemerintah (regulasi) dan Kampus (Lembaga pengabdian), fungsi  lembaga tersebut disinergikan yang terpadu guna meningkatkan pemberdayaan ekonomi sekitar kampus.', 0, 'Berkas LL tidak diunggah atau tidak terbaca', 2013, NULL),
(53, '0715017101', 'Masyarakat pengguna teknologi pembuatan silase: pembudidaya ikan (tawar, payau, laut) masyarakat di daerah pesisir', 'Teknologi Tepat Guna (TTG)', 'Masyarakat pengguna teknologi pembuatan silase: pembudidaya ikan (tawar, payau, laut) masyarakat di daerah pesisir', 1, '', 2013, NULL),
(54, '0715017101', 'Penggunaan berbagai asam organik dan nbakteri Asam Laktat terhadap Nilai Nutrisi Limbah Ikan', 'Teknologi Tepat Guna (TTG)', 'Limbah ikan merupakan hasil samping tangkapan yang tidak bernilai ekonomis. Pemanfaatan Limbah Ikan sebagai Silase adalah Teknologi Tepat Guna(TTG) yang tidak menimbulkan pencemaran lingkungan,mudah dan murah.Silase ikan merupakan produk cair dari ikan-ikan yang terbuang/rucah(tras fish) yang diawetkan dalam suasana asam, dan berpotensi digubakan sebagai bahan penyusun pakan ikan. Untuk meningkatkan kualitas Nutrisi Silase ikan diperlukan teknologi pengolahan yang murah dan mudah. Teknologi pembuatan silase ikan dapat dilakukan dengan cara biologis maupun kimia, dan sampai saat ini belum didapatkan hasil yang maksimal sehingga diperlukan penelitian untuk mendapatkan Teknologi Tepat Guna', 1, '', 2013, NULL),
(55, '0021066601', 'Pewarna alami dari Bunga (edisi pembuatan pewarna)', 'Teknologi Tepat Guna (TTG)', 'Invensi ini berhubungan dengan produk pewarna alami dari beberapa mahkota bunga (mawar, kana, turi merah dll) dan proses pembuatannya dengan metode ekstraksi menggunakan pelarut campuran aquades dan asam sitrat, agar praktis dan hasilnya aman dikonsumsi. Lebih khusus lagi invensi ini berhubungan dengan proses pembuatan pewarna alami dari bunga mawar merah (sortiran) dalam bentuk cair-pekat (konsentrat) dan bubuk, serta potensi penggunaannya sebagai antioksidan. ', 1, '', 2013, NULL),
(56, '0021066601', 'Teknologi Tepat Guna : Teknologi Proses Pembuatan Pewarna alami dari hayati lokal, al bunga', 'Teknologi Tepat Guna (TTG)', 'Teknologi ini berhubungan dengan produk pewarna alami dari pigmen hayati lokal dari beragam bunga (mawar, kana merah, buah naga merah, buah anggur probolinggo) dan proses pembuatannya dengan metode ekstraksi menggunakan pelarut campuran aquades dan asam sitrat, agar praktis dan hasilnya aman dikonsumsi. Lebih khusus lagi invensi ini berhubungan dengan proses pembuatan pewarna alami dari bunga mawar merah (sortiran) dalam bentuk cair-pekat (konsentrat) dan bubuk, serta potensi penggunaannya sebagai antioksidan.', 1, '', 2013, NULL),
(57, '0721018502', 'MUSEUM ETNOFARMASI INDONESIA: KONSEP WISATA ETNOFARMASI UNTUK MEWUJUDKAN MASYARAKAT SEHAT MELALUI SWAMEDIKASI OBAT TRADISIONAL YANG BERKUALITAS', 'Rekayasa Sosial', 'MENGARAH KE BUKU : YANG BERISI GAGASAN DESAIN WISATA EDUKASI BERBASIS PENGETAHUAN TENTANG OBAT TRADISIONAL YANG DI KEMAS DALAM WISATA MUSEUM', 1, '', 2014, NULL),
(58, '0721036201', 'Wawasan Kebangsaan dan Pendidikan Politik Partisipatif Integratif Berbasis Civil Society', 'Model', 'Model pendidikan politik partisipatif integratif berbasis civil society, adalah model politik yang menintegrasikan semua lini (parpol, perguruan tinggi, LSM/NGO dalam memberikan pengetahuan politik, wawasan kebangsaan dan kesadaran politik bagi kader parpol dan konstituennya.  Hal ini dilakukan untuk meningkatkan kualitas kader parpol dan konstituennya.  Sehingga demokrasi yang kita bangun benar-benar demokrasi yang berbasis ke Indonesiaan sesuai kearifan lokal.', 1, '', 2014, NULL),
(59, '0715096401', 'Pengembangan Model Pendidikan Karakter Pada Pembelajaran MIPA Melalui Konsep Integratif di SMP Muhammadiyah se-Malang Raya', 'Model', 'Pendidikan karakter di Sekolah dilaksanakan melalui kegiatan pembelajaran di kelas, ekstra kurikuler, dan budaya sekolah, namun dalam pelaksanaannya hanya dominan pada kegiatan ekstra kurikuler dan budaya sekolah, dan belum  mampu dilaksanakan secara maksimal melalui pembelajran.\nMata pelajaran MIPA di SMP sangat strategis untuk implementasi pendidikan karakter, namun banyak guru mata pelajaran MIPA belum mengenal mengintegrasikan pendidikan karakter ke dalam mata pelajran MIPA.\nBerdasarkan kebutuhan inilah, maka di susun modul panduan guru MIPA untuk mengajar MIPA dengan mengintegraikan pendidikan karakter.\n', 1, '', 2014, NULL),
(60, '0021066601', 'Gerakan Generasi Sehat-Cerdas', 'Model', 'Surat kerjasama, “Gerakan Generasi Sehat-Cerdas”, sbg kegiatan bersama merupakan kerjasama Kantin sehat dengan SMAN Bangil-Pasuruan; AJPI (Asosiasi Jasaboga Indonesia/pasuruan', 1, '', 2014, NULL),
(61, '0021066601', 'Kerjasaam dengan PT Molindo : Meneliti & memproduksi tablet effervescent pigmen antosianin Tim Elfi Anis dkk', 'Teknologi Tepat Guna (TTG)', ' Suplemen berupa tablet effervescent pigmen antosianin dari beragam bunga (mawar, kana merah) yg mengandung antioksidan tinggi dapat mencegah penyakit hati, ginjal bahkan tumor, kanker ', 1, '', 2014, NULL),
(62, '0021066601', 'Pembuatan pangan alternatif berbasis pigmen dan olahan sayuran', 'Teknologi Tepat Guna (TTG)', 'Pembuatan pangan alternatif berbasis pigmen dan olahan sayuran yang diperoleh dari lahan pertanian/pekarangan masyarakat setempat, digunakan untuk merintis atau meningkatkan kesejahteraan keluarga', 1, '', 2014, NULL),
(63, '0021066601', 'Pembuatan Pewarna Alami pada Makanan di MA Hasyim Ash’ari Tulung agung ', 'Teknologi Tepat Guna (TTG)', 'Seminar Kewirausahaan “ Dengan Pigmen meningkatkan Kualtas Produk pangan” dan Demo Pembuatan Pewarna Alami pada Makanan di MA Hasyim Ash’ari Tulung agung Tulung agung pada 10 Mei 2014', 1, '', 2014, NULL),
(64, '0021066601', 'Perkembangan Paten Pewarna Alami di Indonesia', 'Teknologi Tepat Guna (TTG)', 'Perkembangan Paten Pewarna Alami di Indonesia yang merupakan hasil eksplorasi hayati lokal setempat, seperti bunga mawar, kana, turi merah dan kulit buah naga serta rumput laut (merah, coklat dan hijau)', 1, '', 2014, NULL),
(65, '0021066601', ' Sumber Warna, sub Pewarna alami bungatelevisi trans 7 acara LAPTOP UNYIL pada RABU, 28 Agustus 2013, pukul 12.45 WIB', 'Model', 'Masyarakat diharapkan mengetahuai beragam Sumber Warna, sub Pewarna alami bunga, diantaranya dari bahan alam yaitu beberapa bunga antara lain bunga mawar, kana merah, pada http://mytrans.detik.com/video/2013/10/01/48/65/57/15887/sumber-warna-yang-menggemaskan?m991101recen_add', 1, '', 2014, NULL),
(66, '0708037701', 'materi pelatihan profesionalisme guru akselerasi', 'Model', 'materi diberikan saat peneliti memberikan pelatihan tentang model pengajaran pada siswa akselerasi di SMA I Kediri', 0, 'Berkas LL tidak diunggah atau tidak terbaca', 2014, NULL),
(67, '0703037901', 'Metode Detoksifikasi Bunkil Biji Jarak Pagar Secara Kimiawi Untuk Menigkatkan Kualitas Nutrisi bahan Pakan Ikan', 'Rekayasa Sosial', 'Pemanfaatan bungkil biji jarak pagar (BBJP) dari limbah proses biodesel sampai saat ini belum diupayakan secara maksimal. Bungkil biji jarak pagar walupun memiliki kadar protein yang tinggi, namun juga mengandung senyawa antinutrien (phytate) dan senyawa toksik (phorbol ester)', 0, '', 2014, NULL),
(68, '0716096201', 'Aplikasi Web Sistem Informasi Bursa Komoditi Daerah', 'Teknologi Tepat Guna (TTG)', 'Proses instalasi aplikasi web bursa komoditi terbagi menjadi dua konfigurasi, yaitu konfigurasi sistem dan konfigurasi sms gateway. ', 1, '', 2015, NULL),
