(71, '0723028801', 'Lective : Desain RPS dan RPP Online', 'Teknologi Tepat Guna (TTG)', 'Aplikasi LECTIVE merupakan prototype desain silabus dan RPP online. Berbagai fitur yang tersedia dalam LECTIVE antara lain mensinergikan RPS dan RPP dengan Kerangka Kualifikasi Nasional Indonesia dan Standar Nasional Pendidikan Tinggi. LECTIVE juga menyediakan berbagai metode pembelajaran, berbagai metode penilaian dan template aktivitas pembelajaran berdasarkan metode – metode pembelajaran berbasis student centered learning', 1, '', 2015, NULL),
(72, '0723028801', 'Sistem Monitoring LPG 3Kg dan Sistem Transaksi Berbasis Mobile', 'Teknologi Tepat Guna (TTG)', 'Sistem teknologi informasi berbasis sistem informasi geografis dengan teknologi mobile dan  web dalam pendistribusian LPG 3 kg secara tertutup di wilayah Malang Raya. Berdasarkan tahapan yang telah dilakukan diperoleh  model matematik untuk penyelesaian permasalahan lokasi-alokasi dalam rantai distribusi LPG 3 kg di wilayah Malang Raya, perancangan Sistem Pendukung Keputusan berbasis Sistem Informasi Geografis (SIG), dan sistem transaksi  teknologi mobile.', 1, '', 2015, NULL),
